import React from "react";
import { Row, Col, Card, TextInput } from "react-materialize";

class SeachBox extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <Row>
        <Col m={12} s={12}>
          <Card
            className="blue-grey darken-1"
            textClassName="white-text"
            title="Book Search"
          >
            Enter a book you would like to search 
            <TextInput placeholder="Book" />

          </Card>
        </Col>
      </Row>
    );
  }
}

export default SeachBox;
